import React, { Component } from 'react';
import './ProjectWoW.scss';
import WoWLogo from '../../Assets/Images/logo_transparent.png';

export class ProjectWoW extends Component {
  render() {
    return (
      <div className="projectContainer">
        <h3 className="project__header">
          Warcraft Auctions
        </h3>
        <div className="project__info">
          <div className="project__info__imageBox">
            <img src={WoWLogo} alt="Warcraft Auctions Logo"/>
          </div>
          <p className="project__description">
            About
          </p>
        </div>
      </div>
    )
  }
}

export default ProjectWoW
